import React from "react";
import ReactDom from "react-dom/client";
import "./App.css";


const myelement = (
  <table>
    <tr>
      <th>name</th>
    </tr>
    <tr>
      <td>John</td>
    </tr>
  </table>
);
const root = ReactDom.createRoot(document.getElementById("root"));
root.render(
  <>
    <h1>{hello()}</h1>
  </>
);
